Require Dastardly Trick
<Learn Require Skill: 332>

*T2 COSTS*
<Learn Cost>
JP: 400
Gold: 175
</Learn Cost>

<Pre-Damage Eval>
var adjVal = Math.round(value * 0.75);
var tpDrain = Math.round((adjVal / b.mhp) * 100);
$gameTemp._trickTpDrain = tpDrain.clamp(0, b.tp);
value = Math.round(value * 0.25);
</Pre-Damage Eval>

<Post-Damage Eval>
if ($gameTemp._trickTpDrain) {
   b.gainTp(-$gameTemp._trickTpDrain);
   a.gainTp($gameTemp._trickTpDrain);
}

$gameTemp._trickTpDrain = undefined;
</Post-Damage Eval>

